import React, { Component } from 'react';
import { Container,  Nav, Navbar } from 'react-bootstrap';
import logo from './logo.png';
import {BrowserRouter as Router,  Switch, Route} from "react-router-dom";
import FilesNav from "../Pages/FilesNav";
import DBNav from "../Pages/DBNav";
import ParsingNav from "../Pages/ParsingNav";
import ButFiles from "../Components/ButFiles";
class Header extends Component {
    render() {
        return (
            <>
                <Navbar sticky="top" collapseOnSelect expand="md" bg ="dark" variant ="dark">
                    <Container>
                        <Navbar.Brand href="/">
                            <img
                                src={logo}
                                height="70"
                                width="70"
                                className="d-inline-flex align-middle"
                                alt="Logo"
                            /> SympChecker
                        </Navbar.Brand>
                        <Navbar.Toggle aria-controls="responsive-navbar-nav"/>
                        <Navbar.Collapse id = "responsive-navbar-nav">
                            <Nav className = "mb-auto fs-3">
                                <Nav.Link href="/docfiles">Файлы</Nav.Link>
                                <Nav.Link href="/parsing">Парсинг</Nav.Link>
                                <Nav.Link href="/databases">База данных</Nav.Link>
                            </Nav>
                            
                        </Navbar.Collapse>
                    </Container>
                </Navbar>

                <Router>
                    <Switch>
                        <Route exact path ="/docfiles" component ={FilesNav}/>
                        <Route exact path ="/parsing" component ={ParsingNav}/>
                        <Route exact path ="/databases" component ={DBNav}/>
                    </Switch>
                </Router>
                <blockquote class="blockquote text-center mt-5 fs-3">
                    <p class="mb-0">SympChecker - приложение для автоматизированного извлечения данных и знаний из неструктурированного 
информационного ресурса с целью построение БД 
синдромов и симптомов заболеваний.</p>
                </blockquote>
                <blockquote class="blockquote text-center mt-3 fs-5">
                    <ButFiles></ButFiles>
                </blockquote>
              </>
        );
    }
}

export default Header;
